import React, {Component } from 'react';
//import {BrowserRouter, Link, Route} from 'react-router-dom';

import styles from './stylesheets/MyProfile.module.css'

import ETicket from './ETicket';
import deadpool from "./images/deadpool.jpg";
import alice from "./images/alice.jpg";

class BookingHistory extends Component {

    state = {
        bookings : [
            {id : 'Deadpool', Title : 'Deadpool', Poster : deadpool},
            {id : 'Alice', Title : 'Alice through the looking glass', Poster : alice }
            ]
    }

    componentDidMount() {
        console.log(this.props);
    }

    render() {
        let ETicket = (
        <div className = {styles.profileBox}>
                {/* <p>You don't seem to have any bookings done in the past</p> */}
        {
            this.state.bookings.map ( i => {
                return (
                    <ETicket Title={i.Title} Poster={i.Poster}/>
                )
            })
        }
        </div>
        )

        return (
            {ETicket}
        )
    }
}

export default BookingHistory;
